import React from "react";
import ReactDOM from "react-dom";
import WeatherApp from "./WeatherApp";

import "./styles.css";

function App() {
  return <WeatherApp />;
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
